import React from 'react';
import '../styles/app.css'
import linkedinLogo from "../assets/linkedin-logo.png" 
import githubLogo from "../assets/github-logo.png"

function Home(){
    return (
        <div className = "home">
            Hey, it's Ahmed Alamin! <br/>
            <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center'}}> 
                <a href = "https://www.linkedin.com/in/ahmedalaminn" target="_blank" rel="noopener noreferrer"> <img className = 'logos' src = {linkedinLogo} alt = 'linkedinLogo' /> </a>
                <a href = "https://github.com/ahmedalaminn" target="_blank" rel="noopener noreferrer"> <img className = 'logos' src = {githubLogo} alt = 'githubLogo' /> </a>
            </div> 
        </div>
    );
}

export default Home;
